import React from 'react';
import FavoriteRoundedIcon from '@material-ui/icons/FavoriteRounded';
import IconButton from '@material-ui/core/IconButton';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";
import ShareRoundedIcon from '@material-ui/icons/ShareRounded';
import MoreVertRoundedIcon from '@material-ui/icons/MoreVertRounded';
import "./Cardext.css";

function CardMusic(props) {
    return (
        <div>
            <div className="card container p-0">
                <div className="card-img-top">
                    <img src="https://source.unsplash.com/As8zq82LBpw/300x300" ></img>
                </div>
                <div className="card-body">
                    <p>{props.nameOfSong}</p>
                    <p>{props.nameOfSinger}</p>
                </div>
                <div className="card-footer">
                    <IconButton>
                        <FavoriteRoundedIcon color="dark"/>
                    </IconButton>
                    <IconButton>
                        <ShareRoundedIcon color="primary"/>
                    </IconButton>
                    <IconButton>
                        <MoreVertRoundedIcon color="black"/>
                    </IconButton>
                </div>
            </div>
        </div>
    );
}

export default CardMusic;
